import React, { Component } from "react";
import { connect } from "react-redux";
import { fetchStreams } from "../../actions";

class StreamList extends Component {
	render() {
		return (
			<div>
				<div>stream list</div>
			</div>
		);
	}
}

export default connect(
	null,
	{ fetchStreams }
)(StreamList);
